import React from 'react';
import './Grid.css';

const images = [" https://images.unsplash.com/photo-1558980664-769d59546b3d?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=750&q=80",
"https://images.unsplash.com/photo-1587755868414-9531cb97264a?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=750&q=80","https://images.unsplash.com/photo-1587498500396-ff92feb8c87f?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=334&q=80"]


function GridItem(props){
    return(
      <div className="col-xs-2">
        <img src={props.imgUrl}/>
      </div>
    )
  }

const Grid = () => (
    <div className="container">
    {images.map(function(img){return <GridItem imgUrl={img}/>})}
  </div>
);

export default Grid;
